I mean if the json has a sub-element.

something like

PATCH {"IpAddresses":[{}, {}]}

for PATCH {"IpAddresses":[{}, {}]}

std::vector<nlohmann::json> j;
readJsonPatch("ipAddress/0", j)


Should succeed without an error.

We should also have an EXPECT on the result of res.code() to make sure we are or aren't setting the right error messages on the response.

Something like

EXPECT_EQ(res.result(), 200);
EXPECT_TRUE(res.jsonValue.empty());


Most of your tests need EXPECT statements for these.

This is going to bypass the required checks in the case where it's empty

std::string foo;
readJsonAction(<empty nlohmann object>, res, "foo", foo);

would pass this check incorrectly, when the foo variable is required.


I suspect this whole branch can just be removed, as if jsonRequest is empty, the loop on 470 wont run at all.

Really not understanding this.  This would be "allow extra", not "allow missing".  This isn't the missing check, this is the extra property check, which doesn't seem right.

As written, won't this allow

nlohmann::json myjson{"foo": "bar"}
readJsonPatch(myjson, "baz", mybaz);

To pass?  That seems wrong.

For this, I think I wanted to read to allow it so that it does not need all elements in the json.

```
nlohmann::json jsonRequest = {{"integer", 1}, {"string", "hello"}};
    EXPECT_TRUE(readJsonAction(jsonRequest, res, "integer", integer));
    EXPECT_EQ(res.result(), boost::beast::http::status::ok);
    EXPECT_TRUE(res.jsonValue.empty());
    EXPECT_EQ(integer, 1);
```

will pas even tho it didn't read everything.

talked offline and that the only difference between readAction and readPatch is that Action can be empty and that's it.

Everything else is the same.

in that case, we just need

```
    if (jsonRequest.empty())
    {
        BMCWEB_LOG_DEBUG << "Json value is empty";
        messages::emptyJSON(res);
        return false;
    }
```
to be different for Action.
